import s from './layout.module.scss';
// import { connect } from 'react-redux';

const Layout = ({ children }) => (
  <div className={s.layout}>
    <div className={s.layout_content}>
      <header>
        <Header />
      </header>
      <main className={s.layout_main_block}>
        {children}
      </main>
    </div>
  </div>
